import React from "react";

class App extends React.Component {
    render() {
        return (
            <div className="counter">
                <div className="counter__inner">
                    <span className="counter__digit"></span>
                    <div className="counter__bg"></div>
                </div>
            </div>
        );
    }
}

export default App;
